import React, { useEffect, useState } from "react";
import { apiGet, apiPost } from "../services/requestService";

export function Login(): JSX.Element {
    const [token, setToken] = useState<{"authorization": string}>();

  async function handleSubmit(
    event: React.FormEvent<HTMLFormElement>
  ): Promise<void> {
    event.preventDefault();
  }
  useEffect(
    () =>{
        apiPost("/api/login", {email: "qq22223s2", password: "aa"}).then((response: any)=> {setToken({"authorization": JSON.parse(response.data)["authorization"]})})
    }
    , []
);

  return (
    <>
      <form onSubmit={handleSubmit}>
        <label>
          Email:
          <input type="text" name="name" />
        </label>
        <br />
        <label>
          Password:
          <input type="password" name="name" />
        </label>
        <br />
        <input type="submit" value="Login" />
      </form>
      <a href="/registry">
        <button type="button">Sign Up</button>
      </a>
    </>
  );
}
